    private class SocketBucket {
        public final Socket socket;
        public final OutputStream out;
        public SocketBucket(Socket socket) throws IOException {
            this.socket = socket;
            out = socket.getOutputStream();
            socket.setSoTimeout(1);  // VERY short timeout
        }
    }

